(130, 'Текст авито шины екат', 'На заказ 10-20 дня дней доставка включена в цену.\r\nПродам [+TABLE=19+] [+INTER=12+] [+INTER=13+] [+ATTR=18+][+ATTR=19+], остатки протектора(мм) - [+INTER=11+], год [+ATTR=10+],   страна производитель - [+ATTR=11+]. `(strlen("[+ATTR=35+]")>1)?("[+ATTR=35+]"):("")`\r\nБез грыж и порезов. Состояние на фото. Продаются без дисков, могу подобрать диски за отдельную плату. Обмен не интересен. Возможна отправка по России, в Казахстан, Беларусь. Предоставлю дополнительные фотографии. \r\n', 1, 'managerActions', 0, 1);
